import React, { Component } from "react";

class App extends Component {
  state = {};
  render() {
    return (
      <div>
        <container>
          <img
            src="/img/projectPictures/soloStander/landing.png"
            alt="solo stander"
          />
        </container>
      </div>
    );
  }
}

export default App;
